import profileCon from '../assets/images/profileConsole.jpg'

const About = () => {
  return (
    <>
      <div>
        <h1>ABOUT</h1>
        <div>
          <img src={profileCon}
            alt="profileConsole"
          />
        </div>
      </div>
    </>
  )
}

export default Abour;
